var swapPlayer = function(symbol){
    var otherSymbol = symbol == "O" ? "X" : "O"
    var player = document.getElementById("ttt-player" + symbol).innerHTML;
    var otherPlayer = document.getElementById("ttt-player" + otherSymbol).innerHTML;
    if (msg.innerHTML == "player O won!" || msg.innerHTML == "player X won!"|| msg.innerHTML == "Tie."){
        restart()
    }
    if (player == human && otherPlayer == human){
        document.getElementById("ttt-player" + symbol).innerHTML = robot;
    } else if (player == human && otherPlayer == robot){
        document.getElementById("ttt-player" + otherSymbol).innerHTML = human;
        document.getElementById("ttt-player" + symbol).innerHTML = robot;
    } else if (player == robot && otherPlayer == human){
        document.getElementById("ttt-player" + symbol).innerHTML = human;
    }

    if (document.getElementById("ttt-player" + currentPlayer()).innerHTML == robot){
        robotPlay()
    }
}
var restart = function(){
    arr.fill(0);
    for (i = 1; i < 10; i++){
        document.getElementById("ttt-" + i.toString()).innerHTML = "";
    }
    msg.innerHTML = "Player O's turn";
    if (document.getElementById("ttt-player" + currentPlayer()).innerHTML == robot){
        robotPlay()
    }
}
var currentPlayer = function(){
    return arr.reduce((r,x)=>r+x, 0) > 0 ? "X" : "O"
}
var robotPlay = function(){
    var moves;
    var qrow = qtable[arr.map(x => (x==-1?2:x)).reduce(function(r,a,i){return r + a*keyVector[i] }, 0)];
    if (currentPlayer() == "O") {
        moves = qrow.map((x, i) => [x,i]).sort((a,b)=>(b[0]-a[0])).map(x=>x[1])
    } else {
        moves = qrow.map((x, i) => [x,i]).sort((a,b)=>(a[0]-b[0])).map(x=>x[1])
    }
    msg.innerHTML = "ðŸ¤– is thinking..."
    setTimeout(function(){
        for (var i = 0; i < moves.length; i++){
            if (!document.getElementById("ttt-"+(moves[i]+1).toString()).innerHTML){
                clickButton(moves[i]+1);
                break;
            }
        }
    }, 700)
}
var clickButton = function(idx){
    var cell = document.getElementById("ttt-"+idx.toString());
    if (cell.innerHTML || msg.innerHTML == "player O won!" || msg.innerHTML == "player X won!" || msg.innerHTML == "Tie."){
        return
    }

    cell.innerHTML = currentPlayer();
    arr[idx-1] = cell.innerHTML == "X" ? -1 : 1

    if (arr[0] ==  1 &&  arr[1] ==  1 && arr[2] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[0] == -1 &&  arr[1] == -1 && arr[2] == -1){return msg.innerHTML = "player X won!"; }

    if (arr[0] ==  1 &&  arr[3] ==  1 && arr[6] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[0] == -1 &&  arr[3] == -1 && arr[6] == -1){return msg.innerHTML = "player X won!"; }
    if (arr[1] ==  1 &&  arr[4] ==  1 && arr[7] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[1] == -1 &&  arr[4] == -1 && arr[7] == -1){return msg.innerHTML = "player X won!"; }
    if (arr[2] ==  1 &&  arr[5] ==  1 && arr[8] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[2] == -1 &&  arr[5] == -1 && arr[8] == -1){return msg.innerHTML = "player X won!"; }
    if (arr[0] ==  1 &&  arr[4] ==  1 && arr[8] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[0] == -1 &&  arr[4] == -1 && arr[8] == -1){return msg.innerHTML = "player X won!"; }
    if (arr[6] ==  1 &&  arr[4] ==  1 && arr[2] ==  1){return msg.innerHTML = "player O won!"; }
    if (arr[6] == -1 &&  arr[4] == -1 && arr[2] == -1){return msg.innerHTML = "player X won!"; }
    if (arr.reduce((r,x)=>r+(x==1 ? x : 0), 0) == 5 ){

        if (document.getElementById("ttt-player" + currentPlayer()).innerHTML == robot){

        }
    }
}
